    return(
        <div>
    
                <img src={coverImg} alt={title}/>
                <p>Runtime: {Math.floor(runtime/60)}</p>
                <p>Like: {likeCount}</p>
                <h3>Description</h3>
                <p>{descriptionIntro}</p>
        </div>
    )
    } 
